import React from "react";
import styles from "./AboutMe.module.css"
const AboutMe = () => {
    return (
        <React.Fragment>
            <div className={styles['about-me-container']}>
                <h2 className={styles.aboutme} >About Me</h2>
                <ul>
                    li>
                    I am Shashank Raj.
                    I am a web developer and have also developed desktop application.
                    Currently I am learning ReactJs.
                    I also enjoy Competing at CodeChef and Codeforces
                    I have done several projects using the knowledge i have in various fields.
                </ul>
            </div>
        </React.Fragment>
    )
};

export default AboutMe;
